import React, {useState, useEffect} from 'react'

function Track(props) {
    const[track, setTrack] = useState({})
    useEffect(()=>{
        setTrack(props.track)
    }, [props.track, track])
    return (
        <div>
            {track.track_name}
        </div>
    )
}

export default Track
